import React from 'react';
import GroupView from './components/GroupsView';
import Catalog from './components/CatalogView';
import Home from './components/Home';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="" id="nav-view">
        <NavView />
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/catalog">Catalog</Link>
          </li>
          <li>
            <Link to="/groups">Groups</Link>
          </li>
        </ul>
      </div>
      <Switch>
          <Route path="/groups">
            <GroupsView />
          </Route>
          <Route path="/catalog">
            <Catalog />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
    </Router>
  );
}

export default App;
